const NavBar = () => {
  return (
    <header>
      <nav>
        <div>
          <img src="/images/insta-logo.png" alt="instgram-logo" srcset="" />
        </div>
        <div></div>
        <div></div>
      </nav>
    </header>
  );
};

export default NavBar;
